import { FormGroup,FormControl,InputLabel,Input } from "@material-ui/core";

const AddUsers = () => {
    return (
        <FormGroup>
            <FormControl>
                <InputLabel>Name</InputLabel>
                <Input />
            </FormControl>
        </FormGroup>
    )
}

export default AddUsers;
